import styled from "styled-components"
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";

const Container = styled.div`

`;
const MealdealContainer = styled.div`
  width: 80%;
  // border: 1px solid red;
  margin : auto;
`;

const Card = styled.div`
  border: 1px solid red;
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 5%;
  grid-template-rows: repeat(5, 550px);
  border : 1px solid grey;
`;

const MealsDiv = styled.div`
 border : 1px solid grey;
 box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px;
 border-radius: 10px;
`
const Imgdiv = styled.div`
height : 300px;
width : 100%;
border-radius-top: 10px;
border : 1px solid teal;
`
const Img = styled.img`
height : 100%;
width : 100%;
border-radius: 10px;
`
// const Imgtitle = styled.div`
// width : 100%
// height : 15%;
// border : 1px solid red;
// margin: 0;
// `

const P1 = styled.p`
margin : 20px;
color: #777777;
font-size: 18px;
`
const P2 = styled.p`
margin : 0 18px;
font-size: 14px;
`
const Button = styled.button`
display: block;
height: 45px;
width: 40%;
line-height: 25px;
font-size: 18px;
color: #ffffff;
font-weight: bold;
text-decoration: none;
background-color:#f53838;
// background-color: #d41f1f;
cursor: pointer;
margin : 20px;
border : none;
border-radius : 8px;
`
const StarCouponDiv = styled.div`
display : flex;
justify-content : space-between;
border : 1px solid red;
`
const Star = styled.img`
width : 25px;
height : 25px;
margin : 0;
`
const Stardiv = styled.div`
width : 150px;
height : 25px;
margin : 30px 20px;
text-align: left;
// border : 1px solid red;
display : flex;
`
const StarP = styled.p`
font-size: 14px;
color: #bbbbbb;
margin : auto;
`
const Shopdealdiv = styled.div`
width : 100%;
height : 60px;
margin-top : 0px;
display : flex;
border : 1px solid red;
`
const Left = styled.div`
width : 25%;
height : 100%;
margin: 0px;
border : 1px solid black;
display : flex;
`
const Centre = styled.div`
width : 50%;
height : 100%;
margin: 0px;
border : 1px solid black;
`
const Right = styled.div`
width : 25%;
height : 100%;
margin: 0px;
border : 1px solid black;
`
const Leftimgdiv = styled.div`
width : 30%;
margin: 10px 2px 10px 2px;
`
const Leftimg = styled.img`
width : 100%;
height : 100%;
`
const CentreP1 = styled.p`
text-aling : centre;
font-size : 12px;
`
const CentreP2 = styled.p`
text-aling : centre;
color: #fb2222;
font-size: 24px;
`


const MealDeal = () => {
  return (
    <Container>
      <Navbar />
      <MealdealContainer>
        <Card>
          <MealsDiv>
            <Imgdiv>
              <Img src="https://www.kindmeal.my/photos/deal/5/518-3788-l.jpg" alt="" />
              {/* <Imgtitle>Yishensu Oriental Cuisine</Imgtitle> */}
            </Imgdiv>
            <P1>Yishensu —  Petaling Jaya, Selangor</P1>
            <P2>Yishensu offers a wide range of delicious oriental dishes, from traditional favorites to creative fusion delights. Enjoy discount..</P2>
            <StarCouponDiv>
              <Button>Get FREE Coupon</Button>
              <Stardiv>
                <Star src="https://www.kindmeal.my/images/icon_star.png" alt="" />
                <Star src="https://www.kindmeal.my/images/icon_star.png" alt="" />
                <Star src="https://www.kindmeal.my/images/icon_star.png" alt="" />
                <Star src="https://www.kindmeal.my/images/icon_star.png" alt="" />
                <Star src="https://www.kindmeal.my/images/icon_star.png" alt="" />
                <StarP>(22)</StarP>
              </Stardiv>
            </StarCouponDiv>
            <Shopdealdiv>
              <Left>
                <Leftimgdiv>
                  <Leftimg src="https://www.kindmeal.my/images/icon_egg.png" alt="" />
                </Leftimgdiv>
                <Leftimgdiv>
                  <Leftimg src="https://www.kindmeal.my/images/icon_milk.png" alt="" />
                </Leftimgdiv>
                <Leftimgdiv>
                  <Leftimg src="https://www.kindmeal.my/images/icon_alcohol_disabled.png" alt="" />
                </Leftimgdiv>
              </Left>
              <Centre>
                <CentreP1>KindMeal Discount</CentreP1>
                <CentreP2>15% Off</CentreP2>
              </Centre>
              <Right></Right>
            </Shopdealdiv>
          </MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
        </Card>
      </MealdealContainer>
    <Footer />
  </Container>
  )
}

export default MealDeal
